import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Dashboard = () => {
    const [userDetails, setUserDetails] = useState<any>(null); // State to hold user details
    const authenticatedUserEmail = 'user@example.com'; // Replace with your authentication logic

    useEffect(() => {
        // Make an API request to fetch user details by email
        axios.get(`http://localhost:8085/userDetails/${authenticatedUserEmail}`)
            .then(response => {
                setUserDetails(response.data);
            })
            .catch(error => {
                console.log(error);
            });
    }, []);

    return (
        <div className="dashboard-container">
            {userDetails ? (
                <div>
                    <h1>Welcome to your Dashboard, {userDetails.Name}</h1>
                    <div>
                        <p>Email: {userDetails.email}</p>
                        {/* Display other user details here */}
                    </div>
                </div>
            ) : (
                <p>Loading...</p>
            )}
        </div>
    );
}

export default Dashboard;
